import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <img src="image.png" alt="" />
      <Link to="/home">
        <button>Ingresar a la Home Page</button>
      </Link>
    </div>
  );
};

export default LandingPage;
